//
//  PhotosChoose
//  EyeQ
//
//  Created by [Author].
//  Copyright © 2018 [Company]. All rights reserved.
//

import React from "react"
import styles from "./PhotosChooseStyleSheet"
import { Image, Text, View } from "react-native"


export default class PhotosChoose extends React.Component {

	static navigationOptions = ({ navigation }) => {
	
		const { params = {} } = navigation.state
		return {
				header: null,
				headerLeft: null,
				headerRight: null,
			}
	}

	constructor(props) {
		super(props)
	}

	componentDidMount() {
	
	}

	render() {
	
		return <View
				style={styles.viewView}>
				<View
					pointerEvents="box-none"
					style={{
						position: "absolute",
						left: -1,
						right: 0,
						top: 44,
						bottom: 0,
					}}>
					<View
						style={styles.component1420View}>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\group-15@2x copy 2@2x.png")}
							style={styles.group15Image}/>
						<View
							style={styles.group9View}>
							<Image
								source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\modellytics-logo300x-2@2x.png")}
								style={styles.modellyticsLogo300Image}/>
							<View
								style={{
									flex: 1,
								}}/>
							<Text
								style={styles.modellyticsText}>Modellytics</Text>
						</View>
						<View
							style={{
								flex: 1,
							}}/>
						<Image
							source={require("./../../assets/images/ic-forum-24px@2x.png")}
							style={styles.icForum24pxImage}/>
					</View>
					<View
						pointerEvents="box-none"
						style={{
							height: 123,
							marginLeft: 1,
							marginTop: 9,
							flexDirection: "row",
							alignItems: "flex-start",
						}}>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\rectangle-2040@2x.png")}
							style={styles.rectangle2040Image}/>
						<View
							style={{
								flex: 1,
							}}/>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\rectangle-2042@2x.png")}
							style={styles.rectangle2042Image}/>
					</View>
					<View
						pointerEvents="box-none"
						style={{
							height: 123,
							marginLeft: 1,
							marginTop: 2,
							flexDirection: "row",
							alignItems: "flex-start",
						}}>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\rectangle-2043@2x.png")}
							style={styles.rectangle2043Image}/>
						<View
							style={{
								flex: 1,
							}}/>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\rectangle-2045@2x.png")}
							style={styles.rectangle2045Image}/>
					</View>
					<View
						pointerEvents="box-none"
						style={{
							height: 123,
							marginLeft: 1,
							marginTop: 2,
							flexDirection: "row",
							alignItems: "flex-start",
						}}>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2049@2x.png")}
							style={styles.rectangle2049Image}/>
						<View
							style={{
								flex: 1,
							}}/>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2051@2x.png")}
							style={styles.rectangle2051Image}/>
					</View>
					<View
						pointerEvents="box-none"
						style={{
							height: 123,
							marginLeft: 1,
							marginTop: 2,
							flexDirection: "row",
							alignItems: "flex-start",
						}}>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2046@2x.png")}
							style={styles.rectangle2046Image}/>
						<View
							style={{
								flex: 1,
							}}/>
						<Image
							source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2048@2x.png")}
							style={styles.rectangle2048Image}/>
					</View>
					<View
						style={{
							flex: 1,
						}}/>
					<View
						pointerEvents="box-none"
						style={{
							height: 214,
						}}>
						<View
							pointerEvents="box-none"
							style={{
								position: "absolute",
								left: 1,
								right: 0,
								bottom: 0,
								height: 214,
								justifyContent: "flex-end",
							}}>
							<View
								pointerEvents="box-none"
								style={{
									height: 123,
									marginBottom: 47,
									flexDirection: "row",
									alignItems: "flex-end",
								}}>
								<Image
									source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2052@2x.png")}
									style={styles.rectangle2052Image}/>
								<View
									style={{
										flex: 1,
									}}/>
								<Image
									source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2054@2x.png")}
									style={styles.rectangle2054Image}/>
							</View>
							<View
								style={styles.homeIndicatorView}>
								<View
									style={styles.homeIndicatorTwoView}/>
							</View>
						</View>
						<View
							style={styles.rectangle5View}/>
						<View
							style={styles.ellipse47View}/>
						<Text
							style={styles.textText}>1</Text>
					</View>
				</View>
				<View
					pointerEvents="box-none"
					style={{
						position: "absolute",
						alignSelf: "center",
						width: 123,
						top: 98,
						bottom: 58,
						alignItems: "center",
					}}>
					<Image
						source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\rectangle-2041@2x.png")}
						style={styles.rectangle2041Image}/>
					<Image
						source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\images\rectangle-2044@2x.png")}
						style={styles.rectangle2044Image}/>
					<Image
						source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2050@2x.png")}
						style={styles.rectangle2050Image}/>
					<Image
						source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2047@2x.png")}
						style={styles.rectangle2047Image}/>
					<View
						style={{
							flex: 1,
						}}/>
					<Image
						source={require("C:\Users\Edeki Okoh1\Desktop\Modellytics\Mobile\EyeQ\assets\imagesectangle-2053@2x.png")}
						style={styles.rectangle2053Image}/>
					<Text
						style={styles.selectText}>Select</Text>
				</View>
				<View
					style={styles.rectangle2044View}/>
				<Image
					source={require("./../../assets/images/group-544@2x.png")}
					style={styles.group544Image}/>
			</View>
	}
}
